        <div className="container">
        <div className="row">
            {/* Column 1*/}
            <div className="col-md-3 col-sm-6">
            <h4>Contact</h4>
            <ul className="list-unstyled">
            <li>Anup Das</li>
                <li>Lane no.7,Gauri Apartment</li>
                <li>Flat no.103,Dhanori,</li>
                <li>Pune-411015</li>
                <li>MO-+91-8605575578 </li>
            </ul>
            </div>

             {/* Column 2*/}
             <div className="col-md-3 col-sm-6">
            <h4>Services</h4>
            <ul className="list-unstyled">
               
                <li><a href="/RFID"> RFID Solutions</a></li>
                <li><a href="/Customised">Customized Development</a></li>
                <li><a href="/MobileApp">Mobile Development</a></li>
            </ul>
            </div>

             {/* Column 3*/}
             <div className="col-md-3 col-sm-6">
            <h4>Contact3</h4>
            <ul className="list-unstyled">
                <li>a3</li>
                <li>b3</li>
                <li>c3</li>
                <li>d3</li>
            </ul>
            </div>

            {/* Column 4*/}
            <div className="col-md-3 col-sm-6">
            <h4>Contact4</h4>
            <ul className="list-unstyled">
                <li>a4</li>
                <li>b4</li>
                <li>c4</li>
                <li>d4</li>
            </ul>
            </div>

        </div>
        {/* Footer Bottom */}
            <div className="footer-bottom">
                <p className= "text-xt-center">
                    &copy;{new Date().getFullYear} RetailClick - All Rights Reserved
                </p>

            </div>

        </div>
        </div>
        </FooterContainer>
    );
}
export default Footer;

const FooterContainer = styled.footer`
.footer-middle {
    background: var(--mainDark);
    padding-top: 3rem;
    color: var(--mainWhite);
}
.footer-bottom{
    padding-top: 2rem;
    padding-bottom: 1rem
}


ul li a {
    color: var(--mainGray);
}

ul li a hover{
    color: var(--mainLightGray);
}
`;
